    const convoID = convo._id;

    return (
        <div>
            <textarea id="message" placeholder="Your Message Here"></textarea>
            <button id="send">Send</button>
            <div id="messages"></div>
            <div id='selectedConvoID' value={convoID}></div>
        </div>
    )
}
